import { useParams } from "react-router-dom"

const MessageById = () => {
    const [data, setData] = useState([])
    const { id } = useParams()

    useEffect(() => {

        const getById = async () => {
            try {
                const res = await fetch(`${process.env.REACT_APP_SERVERURL}/message/${id}`)
                const json = await res.json()
                setData(json)
            } catch (err) {
                console.log(err) 
            }
        }
        getById()

    }, [id])

